import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {tester: "CHANGE MEeee"};

    this.callBackEnd = this.callBackEnd.bind(this);
  }

  callBackEnd(e) {
    console.log("WUBBAS LUBBBB");

    var poop = "poop";
    var url = "https://localhost:1337/test"

    fetch(url, 
        {
          method: "GET",
          headers: {
            "Access-Control-Allow-Origin": "*"
          }
        }).then(function(res) {
      console.log("NETWORK CALL SUCCESS " + res);
    });

  }

  render() {

    var test = this.state.tester;

    return (
      <div>
        <button className="button" onClick={this.callBackEnd}>{test}</button>
      </div>
    );
  }
}

export default App;
